import { EntradaDados } from './components/EntradaDados';
import { Historico } from './components/Historico';

function App() {
  const enviarDados = (numero: number) => {
    console.log(numero)
  }

  return (
    <>
      <EntradaDados
        enviarDadosHandler={enviarDados}
      /><br />
      <Historico />
    </>
  );
}

export default App;
